import React from 'react';

function JoiningRequestHeader(){
    return(
        <React.Fragment>
             <tr>
                    <th>Type</th>
                    <th>Emrollment No./Employee id</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Approve</th>
                    <th>Reject</th>
            </tr>
        </React.Fragment>
    )
}


export default JoiningRequestHeader;
